{"language":"Solidity","sources":{"contracts/ItemRegistry.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ItemRegistry {
    struct MedicalItem {
        string name;
        uint256 quantity;
        uint256 price;
    }

    mapping(uint256 => MedicalItem) public items;
    mapping(string => uint256) public itemIdsByName;
    uint256 public itemCount;
    address public owner;

    event ItemAdded(uint256 itemId, string name, uint256 quantity, uint256 price);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action");
        _;
    }

    function addItem(string memory _name, uint256 _quantity, uint256 _price) public onlyOwner {
        require(_quantity > 0, "Quantity must be greater than 0");
        require(itemIdsByName[_name] == 0, "Item with the same name already exists");
        itemCount++;
        uint256 itemId = itemCount;
        items[itemId] = MedicalItem(_name, _quantity, _price);
        itemIdsByName[_name] = itemId;
        emit ItemAdded(itemId, _name, _quantity, _price);
    }
    function getItemIdByName(string memory _name)
        public
        view
        returns (uint256)
    {
        uint256 itemId = itemIdsByName[_name];
        require(itemId > 0, "Item not found");
        return itemId;
    }
    function getItemData(uint256 _itemId)
        external
        view
        returns (
            string memory name,
            uint256 quantity,
            uint256 price
        )
    {
        require(_itemId > 0 && _itemId <= itemCount, "Invalid item ID");
        MedicalItem storage item = items[_itemId];
        return (item.name, item.quantity, item.price);
    }

    function getAllItems()
        public
        view
        returns (
            uint256[] memory,
            string[] memory,
            uint256[] memory,
            uint256[] memory
        )
    {
        uint256[] memory ids = new uint256[](itemCount);
        string[] memory names = new string[](itemCount);
        uint256[] memory quantities = new uint256[](itemCount);
        uint256[] memory prices = new uint256[](itemCount);

        for (uint256 i = 1; i <= itemCount; i++) {
            ids[i - 1] = i;
            names[i - 1] = items[i].name;
            quantities[i - 1] = items[i].quantity;
            prices[i - 1] = items[i].price;
        }

        return (ids, names, quantities, prices);
    }
}
